import { Component } from '@angular/core';

@Component({
  selector: 'wanderlust-header',
  templateUrl: './wanderlust-header.component.html',
  styleUrls: ['./wanderlust-header.component.css']
})
export class WanderlustHeaderComponent {

}


<div class="header">
    <img src="assets/Immagini/Logo_Wanderlust.png" alt="Logo" class="logo">
    <h3 style="color: black; display: inline-block; vertical-align: middle; margin-left: 10px;">Wanderlust</h3>
</div>
